    const history = useHistory()

    async function registerSubscription(event) {
        event.preventDefault()

        const response = await fetch('http://localhost:1337/api/register', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: {
                'name': user.given_name,
                'email': user.email,
                'subscription': "Free"
            },
        })

