                <h2>{user.email}</h2>
                <p>{JSON.stringify(user, null, 2)}</p>

                <button onClick={submitPremium()}>
                    Go Premium
                </button>

                <button onClick={submitFree()}>
                    Go Free
                </button>
            </div>
        )

    )
}

